import { NgInitPage } from './app.po';

describe('ng-init App', () => {
  let page: NgInitPage;

  beforeEach(() => {
    page = new NgInitPage();
  });

  it('should display message saying app works', () => {
    page.navigateTo();
    expect(page.getParagraphText()).toContain('app works!');
  });
});
